import "./App.css";

import {
  Grid,
  Box,
  Typography,
  Button,
  CardMedia,
  CardContent,
  ButtonBase,
  CardActions,
  Card,
} from "@mui/material";

import * as React from "react";

const mockEvents = [
  {
    name: "event1",
    description: "my fun event",
    imagePath: "./images/avocado.png",
  },
  {
    name: "event2",
    description: "my cool event",
    imagePath: "./images/avocado.png",
  },
  {
    name: "event3",
    description: "my event",
    imagePath: "./images/avocado.png",
  },
  {
    name: "event4",
    description: "fun event",
    imagePath: "./images/avocado.png",
  },
  {
    name: "event5",
    description: "very fun event",
    imagePath: "./images/avocado.png",
  },
];

function Events() {
  return (
    <Box padding={4}>
      <Box padding={2}>
        <Typography variant="h6">Events this week</Typography>
      </Box>
      <Grid container spacing={2}>
        {mockEvents.map((mockEvent) => (
          <Grid item xs={3}>
            <ButtonBase
              onClick={() => console.log("hi")}
              padding={0}
              sx={{ wodth: 345 }}
            >
              <Card sx={{ maxWidth: 345 }}>
                <CardMedia
                  sx={{ height: 140 }}
                  image={require("./images/avocado.png")}
                  title="green iguana"
                />
                <CardContent>
                  <Typography gutterBottom variant="h5" component="div">
                    {mockEvent.name}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    {mockEvent.description}
                  </Typography>
                </CardContent>
                {/* <CardActions>
                  <Button size="small">Learn More</Button>
                </CardActions> */}
              </Card>
            </ButtonBase>
          </Grid>
        ))}
        <Grid item xs={3}>
          <Card sx={{ maxWidth: 345 }}>
            <CardMedia
              sx={{ height: 140 }}
              image={require("./images/avocado.png")}
              title="green iguana"
            />
            <CardContent>
              <Typography gutterBottom variant="h5" component="div">
                New
              </Typography>
              <Typography variant="body2" color="text.secondary">
                New
              </Typography>
            </CardContent>
            <CardActions>
              <Button size="small">Create a new event</Button>
            </CardActions>
          </Card>
        </Grid>
      </Grid>
    </Box>
  );
}

export default Events;
